package com.example.tensorflowapplication;

import android.os.Build;
import android.util.Log;

import androidx.test.ext.junit.runners.AndroidJUnit4;
import androidx.test.filters.SdkSuppress;
import androidx.test.platform.app.InstrumentationRegistry;

import com.google.common.io.BaseEncoding;

import org.junit.Assert;
import org.junit.Assume;
import org.junit.Test;
import org.junit.runner.RunWith;
import org.tensorflow.lite.Delegate;
import org.tensorflow.lite.Interpreter;
import org.tensorflow.lite.gpu.CompatibilityList;
import org.tensorflow.lite.gpu.GpuDelegate;
import org.tensorflow.lite.nnapi.NnApiDelegate;
import org.tensorflow.lite.support.common.FileUtil;

import java.io.IOException;
import java.nio.FloatBuffer;

@RunWith(AndroidJUnit4.class)
public class TensorflowTest {
    private static final String TAG = TensorflowTest.class.getSimpleName();

    // MNIST images are 28x28
    public static final int IMAGE_SIZE = 28;

    // TEST_DATA[i] is a list of hex-encoded 28x28 images of the digit `i`
    public static final String[][] TEST_DATA = {
            {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }, {
                    "",
                    "",
                    "",
                    "",
                    ""
            }
    };

    private void test(String name, Delegate... delegates) throws IOException {
        Interpreter.Options interpreterOptions = new Interpreter.Options();
        interpreterOptions.setNumThreads(4);

        for (Delegate delegate : delegates) {
            interpreterOptions.addDelegate(delegate);
        }

        Interpreter interpreter = new Interpreter(
                FileUtil.loadMappedFile(InstrumentationRegistry.getInstrumentation().getTargetContext(), "mnist.tflite"),
                interpreterOptions);

        FloatBuffer imageBuffer = FloatBuffer.allocate(IMAGE_SIZE * IMAGE_SIZE);
        FloatBuffer outputBuffer = FloatBuffer.allocate(10);

        long elapsedNs = 0;
        int correct = 0;
        int wrong = 0;
        for (int digit=0; digit<TEST_DATA.length; digit++) {
            for (String encodedImg : TEST_DATA[digit]) {
                byte[] rawPixels = BaseEncoding.base16().decode(encodedImg);

                imageBuffer.rewind();
                for (byte rawPixel : rawPixels) {
                    imageBuffer.put((rawPixel & 0xff) / 255f);
                }

                long start = System.nanoTime();
                interpreter.run(imageBuffer.rewind(), outputBuffer.rewind());
                elapsedNs += System.nanoTime() - start;

                int bestDigit = 0;
                for (int i = 1; i < 10; i++) {
                    if (outputBuffer.get(i) > outputBuffer.get(bestDigit)) {
                        bestDigit = i;
                    }
                }
                //Log.i(TAG + "-" + name, String.format("Image of digit '%d' classified as digit '%d' (prob=%.1f%%): %s", digit, bestDigit, outputBuffer.get(bestDigit) * 100, digit == bestDigit ? "Ok" : "WRONG"));
                if (digit == bestDigit) {
                    correct++;
                } else {
                    wrong++;
                }
            }
        }
        float elapsedMs = elapsedNs / 1e6f;
        float accuracy = correct / (float)(correct + wrong);
        Log.i(TAG + "-" + name, String.format("Accuracy: %.1f%% (%d/%d)", accuracy * 100, correct, correct + wrong));
        Log.i(TAG + "-" + name, String.format("Inference took %.1fms (%.1fms / image)", elapsedMs, elapsedMs / (correct + wrong)));

        // This model has been trained to ~99% accuracy on the validation set, however give it some extra room
        Assert.assertTrue(accuracy > 0.9);
    }

    /**
     * Executes inference in software, inside Tensorflow-lite's native library
     */
    @Test
    public void testCpu() throws IOException {
        test("CPU");
    }

    /**
     * Executes inference in GPU, if available
     */
    @Test
    public void testGpu() throws IOException {
        CompatibilityList compatibility = new CompatibilityList();
        Assume.assumeTrue("Tensorflow GPU support is unavailable in this platform", compatibility.isDelegateSupportedOnThisDevice());
        test("GPU", new GpuDelegate(compatibility.getBestOptionsForThisDevice()));
    }

    /**
     * Executes inference in GPU, if available
     */
    @Test
    @SdkSuppress(minSdkVersion = 27)
    public void testNNApi() {
        NnApiDelegate.Options options = new NnApiDelegate.Options();

        // Without this we get 'NNApi test failed with errno: 5' on API 32 devices.
        //
        // java.lang.IllegalArgumentException: Internal error: Failed to apply delegate: NN API
        // returned error ANEURALNETWORKS_OP_FAILED at line 4483 while completing NNAPI compilation.
        //
        // Node number 7 (TfLiteNnapiDelegate) failed to prepare.
        //     at org.tensorflow.lite.NativeInterpreterWrapper.createInterpreter(Native Method)
        //     at org.tensorflow.lite.NativeInterpreterWrapper.init(NativeInterpreterWrapper.java:93)
        //     at org.tensorflow.lite.NativeInterpreterWrapper.<init>(NativeInterpreterWrapper.java:66)
        //     at org.tensorflow.lite.NativeInterpreterWrapperExperimental.<init>(NativeInterpreterWrapperExperimental.java:44)
        //     at org.tensorflow.lite.Interpreter.<init>(Interpreter.java:226)
        if (Build.VERSION.SDK_INT >= Build.VERSION_CODES.S_V2) {
            options.setUseNnapiCpu(true);
        }

        NnApiDelegate nnApiDelegate = new NnApiDelegate(options);

        try {
            test("NNApi", nnApiDelegate);
        } catch (Exception e) {
            Log.e(TAG, "NNApi test threw exception", e);
            Assert.fail("NNApi test failed with errno: " + nnApiDelegate.getNnapiErrno());
        } finally {
            nnApiDelegate.close();
        }
    }
}

